  true,\n\t\"url\": null,\n\t\"notes\": \"Precise satellite orbits derived from analysis
  of Global Navigation Satellite System (GNSS) data. Analysis Centers (ACs) of the
  International GNSS Service (IGS) retrieve GNSS data on regular schedules to produce
  precise orbits identifying the position and velocity of the GNSS satellites. These
  orbits are determined sub-daily (ultra-rapid generation), daily (rapid generation),
  and weekly (final IGS product). The IGS Analysis Center Coordinator retrieves these
  individual solutions and generates the official IGS combined orbit products. The
  orbits generated by the individual ACs and the combination products generated by
  the ACCs are available at the CDDIS. These orbits can be used to determine precise
  coordinates of the observing stations, gravity field parameters, and Earth orientation
  parameters. The IGS Final products are the basis for the IGS reference frame and
  are intended for those applications demanding high consistency and quality.\",\n\t\"license_title\":
